import React from 'react';

const About = () => (
  <section className="about">
    <h2>About Me</h2>
    <p>
      Well-qualified Full Stack Developer familiar with a wide range of programming utilities and languages.
      Knowledgeable of backend and frontend development requirements.
      Handles any part of the process with ease.
      Collaborative team player with excellent technical abilities offering Number years of related experience.
      Wants to Make Commendable Contribution in the Field of Computer Science.
    </p>
  </section>
);

export default About;
